import React from 'react'

export const Municipality_select = ({Municipality, fun}) => (
            <datalist id="provience" name="location" onChange={fun}>
                   
            {Municipality.map( (data,i) =>
              <option value={data} key={i} data-tokens={data} name="location" >{data}</option>
                    
            )}
            </datalist>
            


);

export const NewMunicipality_Select = ({Municipality, fun}) => (
  <datalist className=" selectpicker" id="myDropdown" name="location" onChange={fun}>
         
  {Municipality.map( (data,i) =>
    <option value={data} key={i} data-tokens={data} name="location" >{data}</option>
          
  )}
  </datalist>
  


);
